gqH(){return"Privacy Policy \u2013 ASConnect Application\n\n1) Identity of the data controller\nThe data collected within the ASConnect application are processed by AngelmanAnalytics as data controller.\nFor any questions relating to your data or the exercise of your rights, you may contact us at: contact@angelmananalytics.org.\n____________________________________________\n2) Purposes of processing\nThe data processing carried out via the application pursues the following purposes:\n\u2022 Creation and management of your user account for named access to the ASConnect application;\n\u2022 Use of geolocation functionalities in order to view:\n  o Profiles of concerned individuals according to various criteria (geographical distance, genotype, age range);\n  o Improvement of the service and personalization of the user experience.\n\u2022 Extraction of data that do not allow identification of individuals for statistical purposes: number of people affected by Angelman syndrome, age distribution...\n____________________________________________\n3) Categories of data collected\nThe following data may be collected:\n\u2022 Identification data:\n  o gender, last name, first name, email address, password, photo,\n  o secret question and answer (in case of password recovery);\n\u2022 Sensitive data:\n  o genotype, location.\nThe legal basis for these processing activities is the explicit and informed consent of the user.\n____________________________________________\n4) Data retention period\nThe data are retained for the entire duration of account use, then deleted within a maximum period of 12 months after the last activity.\nThe user may exercise their right to erasure at any time directly within the application via the menu:\nPrivacy Policy \u2192 Right to Erasure.\n____________________________________________\n5) Data recipients and hosting\nThe data are securely hosted on PythonAnywhere servers.\nThe data are stored within the European Union.\n(For more information on the host\u2019s data protection policy, see https://www.pythonanywhere.com/privacy/.)\nThe web application is hosted by O2Switch in France, see https://www.o2switch.fr/du-rgpd.pdf.\n____________________________________________\n6) User rights\nIn accordance with Regulation (EU) 2016/679 (GDPR), users have the following rights:\n\u2022 Right of access, rectification and erasure (\u201cright to be forgotten\u201d) \u2014 directly via their profile or the menu Privacy Policy \u2192 Right to Erasure;\n\u2022 Right to object, data portability and restriction of processing;\n\u2022 Right to withdraw consent at any time.\nTo exercise these rights (other than the right to erasure available within the application), you may send an email to contact@angelmananalytics.org.\n____________________________________________\n7) Security and confidentiality\nAll data are encrypted during storage and transmission.\nPasswords are hashed according to best security practices, and all communications with the service take place via the HTTPS protocol.\n____________________________________________\n8) Explicit consent\nRegistration for the ASConnect application requires the explicit and informed consent of the user for the processing described in section 2.\nThe user may withdraw this consent at any time via their account settings or by direct contact at contact@angelmananalytics.org."},
