gqH(){return"Pol\xedtica de privacidad \u2013 Aplicaci\xf3n ASConnect\n\n1) Identidad del responsable del tratamiento\nLos datos recogidos en la aplicaci\xf3n ASConnect son tratados por AngelmanAnalytics en calidad de responsable del tratamiento.\nPara cualquier cuesti\xf3n relativa a sus datos o al ejercicio de sus derechos, puede contactarnos en: contact@angelmananalytics.org.\n____________________________________________\n2) Finalidades del tratamiento\nLos tratamientos de datos realizados a trav\xe9s de la aplicaci\xf3n persiguen las siguientes finalidades:\n\u2022 Creaci\xf3n y gesti\xf3n de su cuenta de usuario para un acceso nominativo a la aplicaci\xf3n ASConnect;\n\u2022 Uso de las funcionalidades de geolocalizaci\xf3n para visualizar:\n  o Perfiles de personas afectadas seg\xfan distintos criterios (distancia geogr\xe1fica, genotipo, rango de edad);\n  o Mejora del servicio y personalizaci\xf3n de la experiencia del usuario.\n\u2022 Extracci\xf3n de datos que no permiten identificar a las personas con fines estad\xedsticos: n\xfamero de personas afectadas por el s\xedndrome de Angelman, distribuci\xf3n por edad...\n____________________________________________\n3) Categor\xedas de datos recogidos\nSe pueden recoger los siguientes datos:\n\u2022 Datos de identificaci\xf3n:\n  o sexo, nombre, apellido, direcci\xf3n de correo electr\xf3nico, contrase\xf1a, fotograf\xeda,\n  o pregunta y respuesta secreta (en caso de olvido de la contrase\xf1a);\n\u2022 Datos sensibles:\n  o genotipo, localizaci\xf3n.\nLa base legal de estos tratamientos es el consentimiento expl\xedcito e informado del usuario.\n____________________________________________\n4) Plazo de conservaci\xf3n de los datos\nLos datos se conservan durante toda la duraci\xf3n del uso de la cuenta y posteriormente se eliminan en un plazo m\xe1ximo de 12 meses tras la \xfaltima actividad.\nEl usuario puede ejercer en cualquier momento su derecho al olvido directamente en la aplicaci\xf3n, a trav\xe9s del men\xfa:\nPol\xedtica de privacidad \u2192 Derecho al olvido.\n____________________________________________\n5) Destinatarios y alojamiento de los datos\nLos datos se alojan de forma segura en los servidores de PythonAnywhere.\nLos datos se almacenan en la Uni\xf3n Europea.\n(Para m\xe1s informaci\xf3n sobre la pol\xedtica de protecci\xf3n de datos del proveedor, consulte https://www.pythonanywhere.com/privacy/.)\nLa aplicaci\xf3n web est\xe1 alojada por O2Switch en Francia, consulte https://www.o2switch.fr/du-rgpd.pdf.\n____________________________________________\n6) Derechos de los usuarios\nDe conformidad con el Reglamento (UE) 2016/679 (RGPD), los usuarios disponen de los siguientes derechos:\n\u2022 Derecho de acceso, rectificaci\xf3n y supresi\xf3n (\xabderecho al olvido\xbb) \u2014 directamente a trav\xe9s de su perfil o del men\xfa Pol\xedtica de privacidad \u2192 Derecho al olvido;\n\u2022 Derecho de oposici\xf3n, portabilidad y limitaci\xf3n del tratamiento;\n\u2022 Derecho a retirar el consentimiento en cualquier momento.\nPara ejercer estos derechos (distintos del derecho al olvido accesible desde la aplicaci\xf3n), puede enviar un correo electr\xf3nico a contact@angelmananalytics.org.\n____________________________________________\n7) Seguridad y confidencialidad\nTodos los datos se cifran durante el almacenamiento y la transmisi\xf3n.\nLas contrase\xf1as se almacenan de forma segura conforme a las buenas pr\xe1cticas de seguridad, y todas las comunicaciones con el servicio se realizan mediante el protocolo HTTPS.\n____________________________________________\n8) Consentimiento expl\xedcito\nLa inscripci\xf3n en la aplicaci\xf3n ASConnect requiere el consentimiento expl\xedcito e informado del usuario para los tratamientos descritos en la secci\xf3n 2.\nEl usuario puede retirar este consentimiento en cualquier momento a trav\xe9s de la configuraci\xf3n de su cuenta o mediante contacto directo en contact@angelmananalytics.org."},
