gqH(){return"Polityka prywatno\u015bci \u2013 Aplikacja ASConnect\n\n1) To\u017csamo\u015b\u0107 administratora danych\nDane zbierane w aplikacji ASConnect s\u0105 przetwarzane przez AngelmanAnalytics jako administratora danych.\nW przypadku pyta\u0144 dotycz\u0105cych danych lub wykonywania praw mo\u017cna skontaktowa\u0107 si\u0119 z nami pod adresem: contact@angelmananalytics.org.\n____________________________________________\n2) Cele przetwarzania\nPrzetwarzanie danych realizowane za po\u015brednictwem aplikacji ma nast\u0119puj\u0105ce cele:\n\u2022 Tworzenie i zarz\u0105dzanie kontem u\u017cytkownika w celu imiennego dost\u0119pu do aplikacji ASConnect;\n\u2022 Korzystanie z funkcji geolokalizacji w celu wy\u015bwietlania:\n  o Profili os\xf3b zainteresowanych wed\u0142ug r\xf3\u017cnych kryteri\xf3w (odleg\u0142o\u015b\u0107 geograficzna, genotyp, przedzia\u0142 wiekowy);\n  o Poprawy us\u0142ugi i personalizacji do\u015bwiadczenia u\u017cytkownika.\n\u2022 Pozyskiwanie danych, kt\xf3re nie pozwalaj\u0105 na identyfikacj\u0119 os\xf3b, do cel\xf3w statystycznych: liczba os\xf3b dotkni\u0119tych zespo\u0142em Angelmana, rozk\u0142ad wiekowy...\n____________________________________________\n3) Kategorie zbieranych danych\nMog\u0105 by\u0107 zbierane nast\u0119puj\u0105ce dane:\n\u2022 Dane identyfikacyjne:\n  o p\u0142e\u0107, imi\u0119, nazwisko, adres e-mail, has\u0142o, zdj\u0119cie,\n  o pytanie i odpowied\u017a tajna (w przypadku utraty has\u0142a);\n\u2022 Dane wra\u017cliwe:\n  o genotyp, lokalizacja.\nPodstaw\u0105 prawn\u0105 przetwarzania jest wyra\u017ana i \u015bwiadoma zgoda u\u017cytkownika.\n____________________________________________\n4) Okres przechowywania danych\nDane s\u0105 przechowywane przez ca\u0142y okres korzystania z konta, a nast\u0119pnie usuwane w terminie nie d\u0142u\u017cszym ni\u017c 12 miesi\u0119cy od ostatniej aktywno\u015bci.\nU\u017cytkownik mo\u017ce w ka\u017cdej chwili skorzysta\u0107 z prawa do bycia zapomnianym bezpo\u015brednio w aplikacji poprzez menu:\nPolityka prywatno\u015bci \u2192 Prawo do bycia zapomnianym.\n____________________________________________\n5) Odbiorcy i hosting danych\nDane s\u0105 bezpiecznie przechowywane na serwerach PythonAnywhere.\nDane s\u0105 przechowywane na terenie Unii Europejskiej.\n(Wi\u0119cej informacji na temat polityki ochrony danych dostawcy znajduje si\u0119 na stronie https://www.pythonanywhere.com/privacy/.)\nAplikacja internetowa jest hostowana przez O2Switch we Francji, zob. https://www.o2switch.fr/du-rgpd.pdf.\n____________________________________________\n6) Prawa u\u017cytkownik\xf3w\nZgodnie z rozporz\u0105dzeniem (UE) 2016/679 (RODO) u\u017cytkownikom przys\u0142uguj\u0105 nast\u0119puj\u0105ce prawa:\n\u2022 Prawo dost\u0119pu, sprostowania i usuni\u0119cia danych (\u201eprawo do bycia zapomnianym\u201d) \u2014 bezpo\u015brednio poprzez profil lub menu Polityka prywatno\u015bci \u2192 Prawo do bycia zapomnianym;\n\u2022 Prawo sprzeciwu, przenoszenia danych i ograniczenia przetwarzania;\n\u2022 Prawo do cofni\u0119cia zgody w dowolnym momencie.\nW celu skorzystania z tych praw (z wyj\u0105tkiem prawa do bycia zapomnianym dost\u0119pnego w aplikacji) mo\u017cna wys\u0142a\u0107 wiadomo\u015b\u0107 e-mail na adres contact@angelmananalytics.org.\n____________________________________________\n7) Bezpiecze\u0144stwo i poufno\u015b\u0107\nWszystkie dane s\u0105 szyfrowane podczas przechowywania i transmisji.\nHas\u0142a s\u0105 haszowane zgodnie z najlepszymi praktykami bezpiecze\u0144stwa, a ca\u0142a komunikacja z us\u0142ug\u0105 odbywa si\u0119 za po\u015brednictwem protoko\u0142u HTTPS.\n____________________________________________\n8) Wyra\u017ana zgoda\nRejestracja w aplikacji ASConnect wymaga wyra\u017anej i \u015bwiadomej zgody u\u017cytkownika na przetwarzanie opisane w sekcji 2.\nU\u017cytkownik mo\u017ce wycofa\u0107 t\u0119 zgod\u0119 w dowolnym momencie poprzez ustawienia konta lub kontaktuj\u0105c si\u0119 bezpo\u015brednio pod adresem contact@angelmananalytics.org."},
